package com.jerry.leetcode.slidingwindow;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;

/**
 * 滑动窗口
 * 438. 找到字符串中所有字母异位词
 * https://leetcode-cn.com/problems/find-all-anagrams-in-a-string/
 */
public class FindAnagrams {
    public static void main(String[] args) {
        String s = "";
        String p = "";
        List anagrams = findAnagrams(s, p);
        System.out.println();
        
    }
    public static List<Integer> findAnagrams(String s, String p) {
        char[] sArray = s.toCharArray();
        char[] pArray = p.toCharArray();
        int left = 0;
        int right = 0;
        int index = 0;
        int match = 0;

        List<Integer> result = new ArrayList<>();

        HashMap needs = new HashMap<Integer, Integer>();
        HashMap window = new HashMap<Integer, Integer>();

        //初始化needs
        for(Character c : pArray){
            needs.put(c, (int)needs.getOrDefault(c, 0) + 1);
        }

        while (right < sArray.length){
            char c = sArray[right];
            //匹配数量+1
            if(needs.containsKey(c)){
                //将字符放入窗口
                window.put(c, (int)window.getOrDefault(c, 0) + 1);
                if((int)window.get(c) == (int)needs.get(c)){
                    match++;
                }
            }
            //右移 右指针
            right++;

            while (match == needs.size()){
                // 重点！ 判断 ！！！ 
                if(right - left == pArray.length){
                    result.add(left);
                }
                char leftChar = sArray[left];
                //判断如果 右移 左指针，不匹配结果
                if(needs.containsKey(leftChar)){
                    window.put(leftChar, (int)window.getOrDefault(leftChar, 0) - 1);
                    if((int)window.get(leftChar) < (int)needs.get(leftChar)){
                        match--;
                    }
                }
                //右移 左指针
                left++;
            }
        }
        return result;
    }
}
